import React, { useState } from 'react';
import { useLocation } from 'react-router-dom';
const CooperationTemplate = () => {
    const location = useLocation();
    const { projectTitle, building } = location.state || { projectTitle: "Unknown Project", building: { title: "Unknown Cooperation" } };
    
    
    const [formData, setFormData] = useState({
        title: '',
        eik: '',
        address: '', // добавено за адрес
        parcelArea: '',
        startDate: new Date(),
        endDate: new Date(),
        buildingCount: '', // преименувано от apartments на buildingCount
        buildingStatus: '',
      });
      const [errors, setErrors] = useState({});
      const [success, setSuccess] = useState(null);
    
      const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({
          ...formData,
          [name]: value,
        });
      };
    
      const handleDateChange = (date, name) => {
        setFormData({
          ...formData,
          [name]: date,
        });
      };

    return (
        <div>
            <h1>Cooperation: {building.title} in {projectTitle}</h1>
            <div className="buildings-container">
            <div>Description: {building.description}</div>
            <div>Rsp:{building.rsp}</div>
            <div>Stages: AKT 14, AKT 15{building.rsp}</div>

                

            </div>
        </div>
    );
};

export default CooperationTemplate;
